        .light {
            position: absolute;
            height: 10px;
            width: 10px;
            border-radius: 50%;
            top: 5px;
            left: 115px;
            transform-origin: 5px 115px;
        }

        .light-twinkling {
            animation: 1s twinkling 3, 100ms 3s twinkling 3;
        }

        .light:nth-child(2n) {}

        .light:nth-child(2n + 1) {}

        .light:nth-child(2) {
            transform: rotate(36deg);
        }

        .light:nth-child(3) {
            transform: rotate(72deg);
        }

        .light:nth-child(4) {
            transform: rotate(108deg);
        }

        .light:nth-child(5) {
            transform: rotate(144deg);
        }

        .light:nth-child(6) {
            transform: rotate(180deg);
        }

        .light:nth-child(7) {
            transform: rotate(216deg);
        }

        .light:nth-child(8) {
            transform: rotate(252deg);
        }

        .light:nth-child(9) {
            transform: rotate(288deg);
        }

        .light:nth-child(10) {
            transform: rotate(324deg);
        }

        .wildernessRuins-panel {
            margin: 24px auto 0;
            position: relative;
            height: 200px;
            width: 200px;
            border-radius: 100px;
            overflow: hidden;
        }

        .wildernessRuins-sector {
            position: absolute;
            left: 100px;
            top: 0px;
            width: 100px;
            height: 200px;
            font-size: 14px;
            border-radius: 0px 100px 100px 0;
            overflow: hidden;
            transform-origin: left center;
        }

        .wildernessRuins-sector:nth-child(1) {
            transform: rotate(-45deg);
        }

        .wildernessRuins-sector:nth-child(2) {
            transform: rotate(0deg);
        }

        .wildernessRuins-sector:nth-child(3) {
            transform: rotate(45deg);
        }

        .wildernessRuins-sector:nth-child(4) {
            transform: rotate(90deg);
        }

        .wildernessRuins-sector:nth-child(5) {
            transform: rotate(135deg);
        }

        .wildernessRuins-sector:nth-child(7) {
            transform: rotate(180deg);
        }

        .wildernessRuins-sector:nth-child(8) {
            transform: rotate(225deg);
        }

        .wildernessRuins-sector:nth-child(2n + 1).wildernessRuins-sector-inner {}

        .wildernessRuins-sector:nth-child(2n).wildernessRuins-sector-inner {}

        .wildernessRuins-sector-inner {
            text-align: center;
            display: block;
            width: 40px;
            padding: 5px 3px 0 57px;
            height: 195px;
            transform: translateX(-100px) rotate(30deg);
            transform-origin: right center;
            border-radius: 100px 0 0 100px;
        }

        .wildernessRuins-sector-inner span {
            display: block;
            transform-origin: center;
            transform: rotate(-19deg);
            color: #d46854;
        }

        let wildernessRuinsisDragging = false;


        wildernessRuinsprogressBarPP.addEventListener('mousedown', (e) => {
            e.stopPropagation(); // 
            wildernessRuinsisDragging = true;
            wildernessRuinsupdateProgressBar(e, wildernessRuinsprogressBarPP, wildernessRuinsprogressPP);
        });

        wildernessRuinsprogressBarPP.addEventListener('mousemove', (e) => {
            e.stopPropagation(); // 

            if (wildernessRuinsisDragging) {
                wildernessRuinsupdateProgressBar(e, wildernessRuinsprogressBarPP, wildernessRuinsprogressPP);
            }
        });

        wildernessRuinsprogressBarPP.addEventListener('mouseup', () => {
            e.stopPropagation(); // 

            wildernessRuinsisDragging = false;
        });
        wildernessRuinssettingIcon.addEventListener('click', (e) => {
            e.stopPropagation(); // 

            if (wildernessRuinsprogressPP == wildernessRuinsprogress1) {
                wildernessRuinssettingIcon.src = wildernessRuinssettingIcon.src == wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg2 ? wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg1 : wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg2
            } else if (wildernessRuinsprogressPP == wildernessRuinsprogress2) {
                wildernessRuinssettingIcon.src = wildernessRuinssettingIcon.src == wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg3 ? wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg4 : wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg3
            }


        });

    }
    function wildernessRuinsupdateProgressBar(e, wildernessRuinsprogressBarPP, wildernessRuinsprogressPP) {
        const progressBarRect = wildernessRuinsprogressBarPP.getBoundingClientRect();
        const width = e.clientX - progressBarRect.left;
        const progressBarWidth = progressBarRect.width;

        const percentage = (width / progressBarWidth) * 100;

        //  left 
        const newStyle = document.createElement('style');
        newStyle.textContent = `
             .wildernessRuins-progress::after {
              left: ${percentage - 1}%; 
         }
        `;
        // 
        document.head.appendChild(newStyle);
        wildernessRuinsprogressPP.style.width = percentage + '%';
        if (wildernessRuinsprogressPP == wildernessRuinsprogress1 && percentage > 0) {
            wildernessRuinssettingIcon1.src = wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg1
        } else if (wildernessRuinsprogressPP == wildernessRuinsprogress2 && percentage > 0) {
            wildernessRuinssettingIcon2.src = wildernessRuinsupdateimgSetting.wildernessRuinsupdateimg3
        }
    }
    function wildernessRuinsresults() {
        wildernessRuinsresult.style.display = "none";
    }
    function wildernessRuinsbacks() {
        if (wildernessRuinspageType == "list") {
            wildernessRuinssettingBtn.style.display = "none";
            wildernessRuinsback.style.display = "none";
            wildernessRuinshome.style.display = "flex";
            wildernessRuinslistpage.style.display = "none";
            wildernessRuinsPlayer.style.display='flex'
        } else {
            wildernessRuinswrapper.style.display = "none";
            wildernessRuinslistpage.style.display = "block";
            wildernessRuinssayHello();
        }
    }
    function wildernessRuinssettingFn(event, val) {

        if (val) {
            wildernessRuinssetting.style.display = 'none'
        } else {
            wildernessRuinssetting.style.display = 'flex'
        }

    }
    function wildernessRuinsgoPage() {
        wildernessRuinspageType = "page";
        //   wildernessRuinsback.style.display = "none";
        wildernessRuinslistpage.style.display = "none";
        wildernessRuinswrapper.style.display = "block";
    }
    function wildernessRuinsplays() {
        if (wildernessRuinsonRotation) return;
        wildernessRuinsonRotation = true;
        wildernessRuinsvalue = wildernessRuinsvalue - 60;
        wildernessRuinscountValue.innerHTML = wildernessRuinsvalue;
        var nextStatus = wildernessRuinsgetReward();
        wildernessRuinstxt.innerHTML = nextStatus.text;
        wildernessRuinsvalue += parseInt(nextStatus.text);
        wildernessRuinsresult.style.display = "none";
        wildernessRuinspointer.style.transform = ` translate(-50%, -59%) rotateZ(${nextStatus.deg}deg)`;
    }
    
</script>

    <div id="wildernessRuins-app">


    </div>
